<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8">
  <meta http-equiv="x-ua-compatible" content="ie=edge">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <title>vue-web-starter</title>


  
    
    <link href="vue-web-starter/css/library.ca921c990d719d9ec054ee3336db9d75.css" rel="stylesheet">
    
    
    <link rel="prefetch" href="vue-web-starter/fonts/MaterialIcons-Regular.012cf6a.woff">
  
    
    <link rel="prefetch" href="vue-web-starter/fonts/MaterialIcons-Regular.570eb83.woff2">
  
    
    <link rel="prefetch" href="vue-web-starter/fonts/MaterialIcons-Regular.a37b0c0.ttf">

  <script src="vue-web-starter/library.4bc6e1d2f4c577d4424c.dll.js"></script>

  <style>
    .loader {
      position: absolute;
      left: calc(50vw - 60px);
      top: calc(50vh - 60px);
      border: 16px solid #f3f3f3;
      border-top: 16px solid #78909C;
      border-radius: 50%;
      width: 120px;
      height: 120px;
      animation: spin 2s linear infinite;
    }


    @keyframes spin {
      0% { transform: rotate(0deg); }
      100% { transform: rotate(360deg); }
    }
  </style>
<link rel="preload" href="vue-web-starter/main.js" as="script"><link rel="prefetch" href="vue-web-starter/main.js"></head>
<body>
<div id="app">
  <div class="loader"></div>
</div>
<script type="text/javascript" src="vue-web-starter/main.js"></script></body>
</html>
